"use strict";(self.webpackChunkonekey=self.webpackChunkonekey||[]).push([[518],{518:e=>{e.exports=JSON.parse('[{"name":"\uc560\uad6d\uac00","text":["\ub3d9\ud574\ubb3c\uacfc \ubc31\ub450\uc0b0\uc774 \ub9c8\ub974\uace0 \ub2f3\ub3c4\ub85d \ud558\ub290\ub2d8\uc774 \ubcf4\uc6b0\ud558\uc0ac \uc6b0\ub9ac\ub098\ub77c \ub9cc\uc138","\ubb34\uad81\ud654 \uc0bc\ucc9c\ub9ac \ud654\ub824\uac15\uc0b0 \ub300\ud55c\uc0ac\ub78c \ub300\ud55c\uc73c\ub85c \uae38\uc774 \ubcf4\uc804\ud558\uc138","\ub0a8\uc0b0 \uc704\uc5d0 \uc800 \uc18c\ub098\ubb34 \ucca0\uac11\uc744 \ub450\ub978 \ub4ef \ubc14\ub78c\uc11c\ub9ac \ubd88\ubcc0\ud568\uc740 \uc6b0\ub9ac \uae30\uc0c1\uc77c\uc138","\uac00\uc744 \ud558\ub298 \uacf5\ud65c\ud55c\ub370 \ub192\uace0 \uad6c\ub984 \uc5c6\uc774 \ubc1d\uc740 \ub2ec\uc740 \uc6b0\ub9ac \uac00\uc2b4 \uc77c\ud3b8\ub2e8\uc2ec\uc77c\uc138","\uc774 \uae30\uc0c1\uacfc \uc774 \ub9d8\uc73c\ub85c \ucda9\uc131\uc744 \ub2e4\ud558\uc5ec \uad34\ub85c\uc6b0\ub098 \uc990\uac70\uc6b0\ub098 \ub098\ub77c \uc0ac\ub791\ud558\uc138"]},{"name":"\uc721\uad70\uac00","text":["\ubc31\ub450\uc0b0 \uc815\uae30 \ubed7\uc740 \uc0bc\ucc9c\ub9ac \uac15\uc0b0","\ubb34\uad81\ud654 \ub300\ud55c\uc740 \uc628\ub204\ub9ac\uc758 \ube5b","\ud654\ub791\uc758 \ud54f\uc904\ud0c0\uace0 \uc790\ub77c\ub09c \uc6b0\ub9ac","\uadf8 \uc774\ub984 \uc6a9\uac10\ud558\ub2e4 \ub300\ud55c \uc721\uad70","\ub192\uc740 \uc0b0 \uac70\uce5c \uace8\uc9dd \uae4a\uc740 \uac15\ubb3c\ub3c4","\uc6b0\ub9ac \uc6a9\uc0ac \uc55e\uc5d0\ub294 \uac70\uce60 \uac83 \uc5c6\ub124","\ub300\ud55c \uc721\uad70 \uc9c4\uaca9\uc5d0 \uc801\uc774 \uc788\ub290\ub0d0","\ubc31\ucc9c\ub9cc \ub300\uad70\ub3c4 \ucd08\ub85c \uac19\ub3c4\ub2e4","\uc790\uc720 \ud3c9\ud654 \uc815\uc758\ub294 \uc6b0\ub9ac\uc758 \uc815\uc2e0","\ubd88\uc758\ub97c \ubb34\ucc0c\ub974\uc790 \uc628 \ub545 \ub05d\uae4c\uc9c0","\ubb34\uc1e0\uac19\uc774 \ud2bc\ud2bc\ud55c \ub10b\uacfc \uc0ac\uc9c0\ub294","\ub300\uc9c0\ub97c \ub4a4\uc9d1\uace0\ub3c4 \ud798\uc774 \ub0a8\ub294\ub2e4","\uc55e\uc73c\ub85c \uc55e\uc73c\ub85c \uc6a9\uc9c4 \ub610 \uc6a9\uc9c4","\uc6b0\ub9ac\ub294 \uc601\uc6d0\ud55c \uc870\uad6d\uc758 \ubc29\ud328","\uc55e\uc73c\ub85c \uc55e\uc73c\ub85c \uc6a9\uc9c4 \ub610 \uc6a9\uc9c4","\uc6b0\ub9ac\ub294 \uc601\uc6d0\ud55c \uc870\uad6d\uc758 \ubc29\ud328!"]},{"name":"\ud1a0\ub07c\uc640 \uac70\ubd81\uc774","text":["\uc61b\ub0a0 \uc61b\uc801\uc5d0 \ube60\ub978 \ud1a0\ub07c\uac00 \ub290\ub9b0 \uac70\ubd81\uc774\ub97c \ub180\ub838\uc2b5\ub2c8\ub2e4.","\uac70\ubd81\uc774\ub294 \ud1a0\ub07c\uc758 \ub180\ub9bc\uc5d0 \uc9c0\uccd0 \uacbd\uc8fc\ub97c \uc81c\uc548\ud588\uc2b5\ub2c8\ub2e4.","\uc790\ub9cc\uc5d0 \ube60\uc9c4 \ud1a0\ub07c\ub294 \uc911\uac04\uc5d0 \ub0ae\uc7a0\uc744 \uc790\uba70 \uc2dc\uac04\uc774 \ucda9\ubd84\ud558\ub2e4\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4.","\ud558\uc9c0\ub9cc \uac70\ubd81\uc774\ub294 \uafb8\uc900\ud788 \ud55c \uac78\uc74c\uc529 \uc804\uc9c4\ud588\uc2b5\ub2c8\ub2e4.","\ud1a0\ub07c\uac00 \uae68\uc5b4\ub0ac\uc744 \ub54c, \uacb0\uc2b9\uc120\uc73c\ub85c \ub2ec\ub824\uac14\uc9c0\ub9cc \uac70\ubd81\uc774\uac00 \uc774\ubbf8 \ub3c4\ucc29\ud574 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.","\uad50\ud6c8: \uafb8\uc900\ud788 \ub178\ub825\ud558\uba74 \uc2b9\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4."]},{"name":"\uc591\uce58\uae30 \uc18c\ub144","text":["\uc7a5\ub09c\uce58\uae30 \uc88b\uc544\ud558\ub294 \uc591\uce58\uae30 \uc18c\ub144\uc774 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.","\uadf8\ub294 \'\ub291\ub300\ub2e4! \ub291\ub300\ub2e4!\'\ub77c\uace0 \uc678\uccd0 \ub9c8\uc744 \uc0ac\ub78c\ub4e4\uc774 \ub2ec\ub824\uc624\uac8c \ud588\uc2b5\ub2c8\ub2e4.","\ub291\ub300\uac00 \uc5c6\ub2e4\ub294 \uac78 \uc54c\uba74 \uadf8\ub4e4\uc744 \ube44\uc6c3\uc5c8\uc2b5\ub2c8\ub2e4.","\uc5b4\ub290 \ub0a0 \uc9c4\uc9dc \ub291\ub300\uac00 \uc640\uc11c \uc18c\ub144\uc774 \ub3c4\uc6c0\uc744 \uccad\ud588\uc2b5\ub2c8\ub2e4.","\ud558\uc9c0\ub9cc \ub9c8\uc744 \uc0ac\ub78c\ub4e4\uc740 \ub610 \ub2e4\ub978 \uac70\uc9d3\ub9d0\uc774\ub77c \uc0dd\uac01\ud574 \uc624\uc9c0 \uc54a\uc558\uace0, \ub291\ub300\uac00 \uc591\ub4e4\uc744 \uc7a1\uc544\uba39\uc5c8\uc2b5\ub2c8\ub2e4.","\uad50\ud6c8: \uc815\uc9c1\uc774 \ucd5c\uc120\uc758 \ubc29\ucc45\uc785\ub2c8\ub2e4. \ub108\ubb34 \uc790\uc8fc \uac70\uc9d3\ub9d0\ud558\uba74 \uc9c4\uc2e4\uc744 \ub9d0\ud560 \ub54c\ub3c4 \uc544\ubb34\ub3c4 \ubbff\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4."]},{"name":"\uc0ac\uc790\uc640 \uc950","text":["\uc0ac\uc790\uac00 \uc791\uc740 \uc950\ub97c \uc7a1\uc544 \uba39\uc73c\ub824 \ud588\uc2b5\ub2c8\ub2e4.","\uc950\ub294 \uc5b8\uc820\uac00 \uc0ac\uc790\ub97c \ub3c4\uc640\uc8fc\uaca0\ub2e4\uace0 \uc57d\uc18d\ud558\uba70 \uc790\ube44\ub97c \uad6c\ud588\uc2b5\ub2c8\ub2e4.","\uc0ac\uc790\ub294 \uc6c3\uc5c8\uc9c0\ub9cc \uc950\ub97c \ub193\uc544\uc8fc\uc5c8\uc2b5\ub2c8\ub2e4.","\ud6c4\uc5d0 \uc0ac\uc790\uac00 \uc0ac\ub0e5\uafbc\uc758 \uadf8\ubb3c\uc5d0 \uac78\ub838\uc2b5\ub2c8\ub2e4.","\uc791\uc740 \uc950\uac00 \ubc27\uc904\uc744 \uac09\uc544 \uc0ac\uc790\ub97c \ud480\uc5b4\uc8fc\uc5b4, \uce5c\uc808\uc740 \uacb0\ucf54 \ub0ad\ube44\ub418\uc9c0 \uc54a\uc74c\uc744 \uc99d\uba85\ud588\uc2b5\ub2c8\ub2e4.","\uad50\ud6c8: \uc544\ubb34\ub9ac \uc791\uc740 \uce5c\uc808\uc774\ub77c\ub3c4 \uacb0\ucf54 \ud5db\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4."]},{"name":"\uac1c\ubbf8\uc640 \ubca0\uc9f1\uc774","text":["\uc5ec\ub984 \ub0b4\ub0b4 \uac1c\ubbf8\ub294 \uc5f4\uc2ec\ud788 \uc77c\ud558\uba70 \uaca8\uc6b8\uc744 \uc704\ud574 \uc2dd\ub7c9\uc744 \uc800\uc7a5\ud588\uc2b5\ub2c8\ub2e4.","\ud55c\ud3b8 \ubca0\uc9f1\uc774\ub294 \ub180\uace0 \ub178\ub798\ud558\uba70 \ubc14\uc05c \uac1c\ubbf8\ub97c \ube44\uc6c3\uc5c8\uc2b5\ub2c8\ub2e4.","\uaca8\uc6b8\uc774 \uc624\uc790 \ubca0\uc9f1\uc774\ub294 \uba39\uc744 \uac83\uc774 \uc5c6\uc5b4 \uad76\uc8fc\ub838\uc2b5\ub2c8\ub2e4.","\ubca0\uc9f1\uc774\ub294 \uac1c\ubbf8\uc5d0\uac8c \uac00\uc11c \uc74c\uc2dd\uc744 \uad6c\uac78\ud588\uc2b5\ub2c8\ub2e4.","\uac1c\ubbf8\ub294 \ub300\ub2f5\ud588\uc2b5\ub2c8\ub2e4. \'\uc5ec\ub984 \ub0b4\ub0b4 \ub180\uc9c0 \ub9d0\uace0 \uaca8\uc6b8\uc744 \uc900\ube44\ud588\uc5b4\uc57c\uc8e0.\'","\uad50\ud6c8: \ubbf8\ub798\ub97c \uc704\ud574 \uc900\ube44\ud558\ub294 \uac83\uc774 \ud604\uba85\ud558\uba70, \ud604\uc7ac\ub9cc\uc744 \uc704\ud574 \uc0b4\uc544\uc11c\ub294 \uc548 \ub429\ub2c8\ub2e4."]}]')}}]);